import { NumberField as BaseNumberField, } from "@microsoft/fast-components-react-base";
import numberFieldSchema from "./number-field.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { NumberFieldStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const NumberField = manageJss(NumberFieldStyles)(BaseNumberField);
